export default class SourceIcon extends React.Component {
  readonly props: {
    url?: string,
    type?: string
    className?: string,
  };

  render() {
    let type = "";
    if (this.props.url) {
      type = getSourceType(this.props.url);
    } else if (this.props.type) {
      type = this.props.type;
    }
    switch(type) {
      case ST.audio:
        return <AudiotrackIcon className={this.props.className} />
      case ST.local:
        return <FolderIcon className={this.props.className}/>;
      case ST.video:
        return <MovieIcon className={this.props.className}/>;
      case ST.playlist:
        return <SubscriptionsIcon className={this.props.className}/>;
      case ST.list:
        return <ListIcon className={this.props.className}/>;
      case ST.reddit:
        return <RedditIcon className={this.props.className}/>;
      case ST.redgifs:
        return <RedGifsIcon className={this.props.className}/>;
      case ST.twitter:
        return <TwitterIcon className={this.props.className}/>;
      case ST.instagram:
        return <InstagramIcon className={this.props.className}/>;
      case ST.tumblr:
        return <TumblrIcon className={this.props.className}/>;
      case ST.imagefap:
        return <ImageFapIcon className={this.props.className}/>;
      case ST.sexcom:
        return <SexComIcon className={this.props.className}/>;
      case ST.imgur:
        return <ImgurIcon className={this.props.className}/>;
      case ST.deviantart:
        return <DeviantArtIcon className={this.props.className}/>;
      case ST.danbooru:
      case ST.e621:
        return <DanbooruIcon className={this.props.className}/>;
      case ST.luscious:
        return <LusciousIcon className={this.props.className}/>;
      case ST.gelbooru1:
      case ST.gelbooru2:
        return <GelbooruIcon className={this.props.className}/>;
      case ST.ehentai:
        return <EHentaiIcon className={this.props.className}/>;
      case ST.bdsmlr:
        return <BDSMlrIcon className={this.props.className}/>;
      case ST.hydrus:
        return <HydrusIcon className={this.props.className}/>;
      case ST.piwigo:
        return <PiwigoIcon className={this.props.className}/>;
      case ST.nimja:
        return <NimjaIcon className={this.props.className}/>;
      default:
        return <div/>
    }
  }
}

